import React from 'react';
import {useState, useEffect} from 'react';
import { useParams } from 'react-router-dom';
import Axios from 'axios';
import Navigation from '../components/Navigation';
import Footer from '../components/Footer';
import LoginDataTable from '../components/LoginDataTable';
import SearchBar from '../components/SearchBar';

function ViewAll() {

  const {search} = useParams(); 

  const [logins, setLogins] = useState([]);

  let websiteArray = []

  for (const member of logins) {
    const siteName = login.websiteName
    websiteArray.push(siteName)
  }

  console.log(websiteArray)

  const loadLogins = async () => {
    const search_url = "http://localhost:4500/view-all/"
    const response = await Axios.get(search_url);
    const data = await response.data;
    console.log(data)
    setLogins(data);
} 

  useEffect(() => {
      loadLogins(setLogins);
  }, []);

  return (
    <div>
      <Navigation />
      <div className ="main-content">
        <SearchBar />
        <div className="block-container">
          <div className="block-container-inner">
            <div className="form-field-container">
              <h3>View All</h3>
              <LoginDataTable logins= {logins}></LoginDataTable>
            </div>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  )
}

export default ViewAll
